import React from "react";
import Search from "../components/Search";
import RecipeList from "../components/RecipeList";
import { getRecipies } from "../services/api";
const Recipies = () => {
  const getSearchedResult = () => {
    getRecipies();
  };

  return (
    <>
      <Search />
      <RecipeList />
    </>
  );
};

export default Recipies;
